import React, { Component } from 'react'
import "../style/contact.css"
import img from "../images/kad2.png";


class contact extends Component {
    render() {
        return (
            <div className="contact">
                <div className="contactImg">
                    <img src={img}></img>
                    <h1>Bize Ulaşın</h1>
                </div>
            </div>
        )
    }
}


export default contact;
